#include "word.h"
#include <stdio.h>
#include <string.h>
#include <assert.h>

static const int NUM_SCRAMBLE = 8869;
static const char SCRAMBLE[8869 * 5 + 1] = "";
//g++ -o play play.cpp word.cpp
//g++ -o grader grader.cpp word.cpp
int main() {
  init(NUM_SCRAMBLE, SCRAMBLE);
  int T;
  scanf("%d", &T);
  char buf[10];
  bool gold[5], silver[5];
  scanf("%s", buf);
  char init_letter = buf[0];
  for (int i = 1; i <= T; i++) {
    const char* guess_word = guess(i, 5, init_letter, gold, silver);
    printf("%s\n", guess_word);
    for (int j = 4; j >= 0; j--) {
      scanf("%s", buf);
      if (strlen(buf) != 5) {
        // next initial letter
        init_letter = buf[0];
        break;
      }
      assert(j > 0);  // we only allow to guess 5 times
      for (int k = 0; k < 5; k++) {
        gold[k] = buf[k] == 'g';
        silver[k] = buf[k] == 's';
      }
      guess_word = guess(i, j, init_letter, gold, silver);
      printf("%s\n", guess_word);
    }
  }
  return 0;
}
